function generate_customize_report() {
    var report_checklist = Array();
    $("input:checked").each(function () {
        report_checklist.push($(this).val());
    });
    var col = [];
    col.push({
        title: 'Name',
        dataKey: 'name'
    });
    $("input:checked").each(function () {
        // Contant Information
        if ($(this).val() == 'rep_mobile_no') {
            col.push({
                title: 'Mobile No',
                dataKey: $(this).val()
            });
        }
        if ($(this).val() == 'rep_telephone_no') {
            col.push({
                title: 'Telephone No',
                dataKey: $(this).val()
            });
        }
        if ($(this).val() == 'rep_email_address') {
            col.push({
                title: 'Email Address',
                dataKey: $(this).val()
            });
        }
        // Personal Information
        if ($(this).val() == 'rep_birthdate') {
            col.push({
                title: 'Birthdate',
                dataKey: $(this).val()
            });
        }
        if ($(this).val() == 'rep_age') {
            col.push({
                title: 'Age',
                dataKey: $(this).val()
            });
        }
        if ($(this).val() == 'rep_perma_address') {
            col.push({
                title: 'Permanent Address',
                dataKey: $(this).val()
            });
        }
        if ($(this).val() == 'rep_prese_address') {
            col.push({
                title: 'Present Address',
                dataKey: $(this).val()
            });
        }
        if ($(this).val() == 'rep_sex') {
            col.push({
                title: 'Sex',
                dataKey: $(this).val()
            });
        }
        if ($(this).val() == 'rep_civilstat') {
            col.push({
                title: 'Civil Status',
                dataKey: $(this).val()
            });
        }
        // Government IDs
        if ($(this).val() == 'rep_PRC') {
            col.push({
                title: 'License No.',
                dataKey: $(this).val()
            });
        }
        if ($(this).val() == 'rep_TIN') {
            col.push({
                title: 'TIN',
                dataKey: $(this).val()
            });
        }
        if ($(this).val() == 'rep_SSS') {
            col.push({
                title: 'SSS',
                dataKey: $(this).val()
            });
        }
        if ($(this).val() == 'rep_PhilHealth') {
            col.push({
                title: 'PhilHealth',
                dataKey: $(this).val()
            });
        }
        if ($(this).val() == 'rep_PAGIBIG') {
            col.push({
                title: 'Pag-IBIG',
                dataKey: $(this).val()
            });
        }
        if ($(this).val() == 'rep_CTC') {
            col.push({
                title: 'CTC No.',
                dataKey: $(this).val()
            });
        }
        // Employment Details
        if ($(this).val() == 'rep_position') {
            col.push({
                title: 'Position',
                dataKey: $(this).val()
            });
        }
        if ($(this).val() == 'rep_section') {
            col.push({
                title: 'Section',
                dataKey: $(this).val()
            });
        }
        if ($(this).val() == 'rep_department') {
            col.push({
                title: 'Department',
                dataKey: $(this).val()
            });
        }
        if ($(this).val() == 'rep_employment_type') {
            col.push({
                title: 'Employment Type',
                dataKey: $(this).val()
            });
        }
        if ($(this).val() == 'rep_yrs_of_service') {
            col.push({
                title: 'Years of Service',
                dataKey: $(this).val()
            });
        }
        if ($(this).val() == 'rep_date_hired') {
            col.push({
                title: 'Date Hired',
                dataKey: $(this).val()
            });
        }
    });
    $.ajax({
        type: 'POST',
        url: 'Reports/generate_custom_reports_pdf',
        data: {
            title: $('#report_title').val(),
            type: sel_status,
            section: sel_section,
            checklist: report_checklist,
            submit: 1
        },
        dataType: 'json',
        success: function (resp) {
            console.log(resp);
            var doc = new jsPDF('l', 'pt', 'a4');
            doc.autoTable(col, resp.dat, {
                margin: {
                    top: 160
                },
                addPageContent: function (data) {
                    doc.addImage(imgData, 'JPEG', 400, 20, 50, 50);
                    doc.setFontSize(9);
                    doc.text("Bethany Hospital Inc.", 366, 80);
                    doc.text("Widdoes St. Brgy. II, City of San Fernando, La Union", 325, 93);
                    doc.setFontSize(11);
                    doc.setFontType('bold');
                    doc.text("E-Skill Registry Report", 368, 105);
                    doc.setFontSize(9);
                    doc.text("Title: " + $('#title2').val() + " - " + $('#spec2').val(), 40, 140);
                },
                styles: {
                    overflow: 'linebreak',
                    columnWidth: 'auto'
                },
                theme: 'grid',
                tableWidth: '100%',
            });
            doc.save('Test.pdf');
        }
    });
}